import React from 'react';
import { Col, Row, ListGroup, Badge } from 'react-bootstrap';

const ListKategori = ({keranjangs}) => {
	console.log(keranjangs)
	return(
		<Col md={3} mt="2">
			<h4><strong>Hasil</strong></h4>
			<hr />
			{keranjangs.length !== 0 && (
				<ListGroup variant="flush">
					{ keranjangs.map((menuKeranjang) => (
						<ListGroup.Item key={menuKeranjang.id}>
							{console.log(menuKeranjang)}
							<Row>
								<Col>
									<Badge variant="primary">{menuKeranjang.jumlah}</Badge>
								</Col>
								<Col>
									<h5>{menuKeranjang.product.nama}</h5>
									<h5>Rp {new Intl.NumberFormat("de-DE").format(menuKeranjang.total_harga)}</h5>
								</Col>
							</Row>
						</ListGroup.Item>
					))}
				</ListGroup>
			)}
		</Col>
	)
}

export default React.memo(ListKategori);
